  const [data,setData]=useState([])
  useEffect(() => {
    setData(useFetch('http://localhost:4001/getproducts'))
  }, []);
  console.log(data)
  return (
    <div>
      <Banner/>
      <FeatureProducts type="Featured"/>
      <Lists/>
      <FeatureProducts type="Trending"/>
      <NewsLetter/>
    </div>
  )
}

export default Home
